import React, {Component} from "react";
import './add_product';
import '../backend/delete.php'
import axios from 'axios';
import $ from 'jquery';

export default  class RecordList extends Component {
    constructor() {
        super();
        this.test = this.test.bind(this);
     
    }

    
    test() {
      var remember = document.getElementById('remember').is(':checked');
      if (remember.checked){
          alert("checked") ;
      }else{
          alert("You didn't check it! Let me check it for you.")
      }
  }
 

  

    render() {


        return(
            
            <div>

            <input type="checkbox" id='checkbox'onChange={this.test}/>
            
            <td className = 'a'>{this.props.obj.d_sku}</td>

            <td className = 'a'>{this.props.obj.d_name}</td>
  
            <td className = 'a'>{this.props.obj.d_price + "$"}</td>
  
            <td className = 'a'>{this.props.obj.d_attribute}</td>
            

            </div>
        )
    }
}
